import React from "react";
import { motion, useScroll } from "framer-motion";

function ZakLogo() {
  return (
    <>
      <motion.div
        initial={{
          opacity: 0,
          x: window.innerWidth / 2,
          y: window.innerHeight / 2,
        }}
        animate={{ opacity: 1, scale: 1, x: 0, y: 0 }}
        transition={{ duration: 2 }}
      >
        <div>
          <h1>زكريا رب</h1>
          <h3>Zakaria Rab</h3>
        </div>
      </motion.div>
    </>
  );
}

export default ZakLogo;
